import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import { ChakraProvider } from '@chakra-ui/react'
import {
  Box,
  Flex,
  Avatar,
  HStack,
  Link,
  IconButton,
  Button,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  Stack,
  Image,
  Text,
} from '@chakra-ui/react';

function App() {
  return (

   <ChakraProvider>
     <Navbar/>
     <>
     <Box bg='#BACEC1' w='100%'>
     <Text fontSize='5xl'>" Mental heatlh at it's eaze "</Text>

    </Box>
     </>
     </ChakraProvider>
  );
}

export default App;
